// === "/some/path/dir/index.js"

const myResolve = resolve.create({
	// \u6216\u8005\u4F7F\u7528 resolve.create.sync
	extensions: [".ts", ".js"]
	// \u67E5\u770B\u4E0B\u9762\u66F4\u591A\u7684\u9009\u9879
});

